class Solution:
    def maximumValueSum(self, A: List[List[int]]) -> int:
        m, n = len(A), len(A[0])
        r = []
        for i in range(m):
            rr = nlargest(3, [[A[i][j], j] for j in range(n)])
            r.append(rr)
        res = -inf
        for i0,i1,i2 in combinations(range(m), 3):
            s = {r[i0][0][1], r[i1][0][1], r[i2][0][1]}
            if len(s) == 3:
                res = max(res, r[i0][0][0] + r[i1][0][0] + r[i2][0][0])
            else:
                for j0, j1, j2 in product(range(3), repeat=3):
                    s = {r[i0][j0][1], r[i1][j1][1], r[i2][j2][1]}
                    if len(s) == 3:
                        res = max(res, r[i0][j0][0] + r[i1][j1][0] + r[i2][j2][0])
        return res
